import { useState, useEffect } from "react";

function Rocketinfo() {
    const [rocketInfo, setRocketInfo]=useState([])
    useEffect(() => {
        fetch("https://api.spacexdata.com/v4/rockets")
        .then((response)=> response.json())
        .then((data) => console.log(data))
    }, [])
    return (
      <div className="Block">
        <h2>Rocket Info</h2>
      </div>
    );
  }

  export default Rocketinfo;
